import Papa from 'papaparse';
import { useEffect, useState } from 'react';
import { Bar } from 'react-chartjs-2';
import { Chart as ChartJS, CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend } from 'chart.js';

ChartJS.register(CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend);

function Home() {
  const [chartData, setChartData] = useState({
    datasets: []
  });
  const [chartOptions, setChartOptions] = useState({});
  const [labelCountData, setLabelCountData] = useState([]);
  const [clickedLabelIndex, setClickedLabelIndex] = useState(null);
  const [showDoubleBarGraph, setShowDoubleBarGraph] = useState(false); // Track the state of the double bar graph

  useEffect(() => {
    Papa.parse('/static/data.csv', {
      download: true,
      header: true,
      dynamicTyping: true,
      delimiter: "",
      complete: (result) => {
        const labelCounts = {};

        result.data.forEach((item) => {
          const label = item['req1Product'];

          if (label) {
            if (labelCounts[label]) {
              labelCounts[label] += 1;
            } else {
              labelCounts[label] = 1;
            }
          }
        });

        setChartData({
          labels: Object.keys(labelCounts),
          datasets: [
            {
              label: "Count",
              data: Object.values(labelCounts),
              borderColor: "white",
              backgroundColor: "#defde0"
            }
          ]
        });

        setChartOptions({
          responsive: true,
          plugins: {
            legend: {
              position: 'top'
            },
            title: {
              display: true,
              text: "Count of req1Product Values",
              color: 'white'
            }
          },
          scales: {
            x: {
              ticks: {
                color: 'white'
              }
            },
            y: {
              beginAtZero: true,
              title: {
                display: true,
                text: "Count",
                color: 'white'
              },
              ticks: {
                color: 'white'
              }
            }
          }
        });
      }
    });
  }, []);

  const handleColumnClick = async (event, activeElements) => {
    if (activeElements.length > 0) {
      const labelIndex = activeElements[0].index;
      setClickedLabelIndex(labelIndex); // Update clicked label index

      const clickedLabel = chartData.labels[labelIndex];

      if (showDoubleBarGraph) {
        // Create a new chart for the label count from each column
        const columnCounts = {};
        await new Promise((resolve, reject) => {
          Papa.parse('/static/data.csv', {
            download: true,
            header: true,
            dynamicTyping: true,
            delimiter: "",
            complete: (result) => {
              Object.keys(result.data[0]).forEach((column) => {
                const columnCount = {
                  0: 0,
                  1: 0
                };

                result.data.forEach((item) => {
                  const label = item['req1Product'];
                  const value = item[column];

                  if (label === clickedLabel && value !== undefined && (value === 0 || value === 1)) {
                    columnCount[value] += 1;
                  }
                });

                columnCounts[column] = columnCount;
              });

              const labelCountChartData = {
                labels: Object.keys(columnCounts),
                datasets: [
                  {
                    label: "Count 0",
                    data: Object.values(columnCounts).map((count) => count[0]),
                    borderColor: "white",
                    backgroundColor: "#ff4040"
                  },
                  {
                    label: "Count 1",
                    data: Object.values(columnCounts).map((count) => count[1]),
                    borderColor: "white",
                    backgroundColor: "#B6E4EB"
                  }
                ]
              };

              const labelCountChartOptions = {
                responsive: true,
                plugins: {
                  legend: {
                    position: 'top'
                  },
                  title: {
                    display: true,
                    text: `Label Count for ${clickedLabel}`,
                    color: 'white'
                  }
                },
                scales: {
                  x: {
                    ticks: {
                      color: 'white'
                    }
                  },
                  y: {
                    beginAtZero: true,
                    title: {
                      display: true,
                      text: "Count",
                      color: 'white'
                    },
                    ticks: {
                      color: 'white'
                    }
                  }
                }
              };

              setLabelCountData((prevData) => {
                const newData = [...prevData];
                newData[labelIndex] = {
                  chartData: labelCountChartData,
                  chartOptions: labelCountChartOptions
                };
                return newData;
              });

              resolve();
            },
            error: (error) => {
              reject(error);
            }
          });
        });
      } else {
        // Create a new chart for the label count from the 'prediction' column
        const predictionLabelCounts = {};
        await new Promise((resolve, reject) => {
          Papa.parse('/static/data.csv', {
            download: true,
            header: true,
            dynamicTyping: true,
            delimiter: "",
            complete: (result) => {
              result.data.forEach((item) => {
                const prediction = item['prediction'];
                const label = item['req1Product'];

                if (label === clickedLabel && prediction !== undefined) {
                  if (predictionLabelCounts[prediction]) {
                    predictionLabelCounts[prediction] += 1;
                  } else {
                    predictionLabelCounts[prediction] = 1;
                  }
                }
              });

              const labelCountChartData = {
                labels: Object.keys(predictionLabelCounts),
                datasets: [
                  {
                    label: "Count",
                    data: Object.values(predictionLabelCounts),
                    borderColor: "white",
                    backgroundColor: ["#ff4040", "#B6E4EB"]
                  }
                ]
              };

              const labelCountChartOptions = {
                responsive: true,
                plugins: {
                  legend: {
                    position: 'top'
                  },
                  title: {
                    display: true,
                    text: `Label Count for ${clickedLabel}`,
                    color: 'white'
                  }
                },
                scales: {
                  x: {
                    ticks: {
                      color: 'white'
                    }
                  },
                  y: {
                    beginAtZero: true,
                    title: {
                      display: true,
                      text: "Count",
                      color: 'white'
                    },
                    ticks: {
                      color: 'white'
                    }
                  }
                }
              };

              setLabelCountData((prevData) => {
                const newData = [...prevData];
                newData[labelIndex] = {
                  chartData: labelCountChartData,
                  chartOptions: labelCountChartOptions
                };
                return newData;
              });

              resolve();
            },
            error: (error) => {
              reject(error);
            }
          });
        });
      }
    }
  };

  const handleCountButtonClick = () => {
    setShowDoubleBarGraph((prevState) => !prevState); // Toggle the state of showDoubleBarGraph
    setLabelCountData([]); // Clear the label count data when toggling the graph
  };

  return (
    <div>
      <h4>Analysis</h4>
      <div className="import-boxes">
        {/* Import boxes code here */}
        <button onClick={handleCountButtonClick}>Count</button> {/* Add a button for toggling the graph */}
      </div>
      {chartData ? (
        <div className="graph-container">
          <div>
            <Bar options={{ onClick: handleColumnClick, ...chartOptions }} data={chartData} />
          </div>
          <div>
            {labelCountData.length > 0 && labelCountData[clickedLabelIndex] && (
              <div>
                <h4>Label Count for {chartData.labels[clickedLabelIndex]}</h4>
                <Bar
                  options={labelCountData[clickedLabelIndex].chartOptions}
                  data={labelCountData[clickedLabelIndex].chartData}
                />
              </div>
            )}
          </div>
        </div>
      ) : (
        <div>Loading...</div>
      )}
      <style>{`
        .graph-container {
          width: 600px; /* Set the desired width */
          height: 400px; /* Set the desired height */
          margin: 0 auto; /* Center the graph container horizontally */
        }
      `}</style>
    </div>
  );
}

export default Home;
